INSERT INTO `hd_article` VALUES ('1', '从产品角度看，运营一个电商需要多少钱？', '<p><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　近期海盗云商团队接触了无数个要进军电商领域的团队和企业，被问及最多的问题就是“运营一个电商需要多少钱？”，这个问题其实很难回答，不同的团队有不同的做法，成本也会根据涉足行业、团队大小、运营支持而不一，在这里，</span><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"><span style=\"word-wrap: break-word; font-weight: 700;\">我们站在产品的角度来给大家算一笔账，看看运营一个电商到底需要多少资金，付出多少代价</span></span><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　以下内容的前提是：重庆、电子商务方向。包含从公司成立到电商运营一年为周期的一些常见的工作，并非十全十美。</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　做电商首先第一条件就是注册公司，为什么这么说？因为电商所涉足的领域很广，尤其是支付环节，比如支付宝、微信支付等支付工具就需要企业资质才可申请并使用！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　公司注册现在是越发简单，要么自己跑跑，要么请一个代理公司就代办了，费用一般不会超过2000元，公司注册后要解决的是工作场所的问题，初期可以选择创业孵化器（前提是你能找到孵化器）或者中低端的办公场所（这类的办公场所，重庆大约是 90元/㎡，大约100平米）。这里有必要稍微提以下孵化器，孵化器的租金会比较便宜（或者不要钱），在接纳创业团队之前一般会签署协议，需要以场地作为股权置换条件，或者是优先投资权，是否划算，得创业团队自己掂量。算上水电、物业，一个月10000左右算比较省了。　　有了办公场地，还需要有办公耗材、宽带之类的（假设电脑自己带），普通的人体工程学椅子价格在150元左右，如果不买工程学椅子也可以，用普通的椅子，加上桌子平摊成本，桌椅需要200左右的成本，这里我们一拍脑袋计算一下，5000元肯定可以搞定了。</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　有了办公场地，人才就是企业的核心了，从整个电商的基本配置来看，得分为行政部、人事部、研发部、销售部、市场部以及财务部（行政人事一般初期均为一个人担任），初期一般会招聘一到两人负责产品的选择，作为初期的筹备，接着就是电商平台的构建，首先假设在开发电商平台之前我们已经有了一个成熟的团队（这是非常幸运的前提，很多产品研发进度极其缓慢的原因之一就是在过程中不断在招人），团队的结构以架构 师兼后台开发1名+产品经理1名+前端开发1名+设计师1名（如需要开发APP还需要安卓1名+iOS开发1名）。你可能也发现了这些人员配备都是单点的，一旦有人生病或请假，某个职位就会缺失，项目进度就会拖后，所以我们大约配备2个浮动名额，也就是，这里我们不计算APP的开发，初始团队大概有6名，我们假设团队平均工资在8000左右（憋惊讶，重庆需要这个数，还是比较低的。。。），需要给员工缴纳五险一金，详见下表（假设我们是老实善良的公司，公积金按最低标准缴纳）</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"center\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\"><table cellspacing=\"0\" class=\"t_table\" style=\"word-wrap: break-word; empty-cells: show; border: 1px solid rgb(227, 237, 245); table-layout: auto; width: 438px;\"><tbody style=\"word-wrap: break-word;\"><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\"><span style=\"word-wrap: break-word; font-weight: 700;\">缴存项目</span></td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\"><span style=\"word-wrap: break-word; font-weight: 700;\">个人部分</span></td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\"><span style=\"word-wrap: break-word; font-weight: 700;\">单位部分</span></td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">养老</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">缴纳8%： 640</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">缴纳20% ：1600</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">医疗</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">缴纳2%：160</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">缴纳7%： 560</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">失业</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">缴纳1%：80</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">缴纳2%：160</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">工伤</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\"></td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">缴纳0.5%： 40</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">生育</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\"></td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">缴纳0.6%： 48</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">公积金</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">缴纳7%： 560</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">缴纳7%： 560</td></tr><tr style=\"word-wrap: break-word;\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">合计</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">1440.00</td><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">2968</td></tr></tbody></table></div><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"left\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　除工资的部分，还要平均为每个员工多缴纳2248元的五险一金支出，员工部分的支出是 （8000+2968）*6=65808元/月，这个仅仅是电商平台的开发人员支出，我们先看看仅仅是平台上线前的开发费用：</div><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"left\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　电商平台需要想个产品的名字、需求调研、竞品调研分析、注册域名、购置服务器以及周边基础能力（如CDN存储、短信服务、消息推送等）、商标（未注册商标、很多团队就是吃了这个亏）、抢注域名、设计logo，这里在一群人的纠结和各种开会，最起码扯一 周，这时候产品的原型、技术架构的雏形也出来了，基本可以进入真刀真枪的干活了。这一步假设域名不需要花大价钱购买，全部费用算起来拍脑袋10000元/ 年 可以搞定。</div><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"left\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　选择网站平台从底层构建还是基于现成的框架开始开发，如果一切顺利，那么在3-6个月之后，你的商城第一版应该有了第一个雏形了，当然接下来就是持续的维护和新功能的迭代以及后续运营阶段的各种专题、活动等，这是一个持续的工作。</div><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"left\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">这里我们按照最低成本估算一个大致成本：<span style=\"word-wrap: break-word; font-weight: 700;\">65808*12+10000=799696/ 年&nbsp;<span style=\"color:#ff0000;word-wrap: break-word;\">（之前一直有朋友咨询过我，为什么开发海盗云商这样一款系统居然要投入超过200万的资金，我就不做解释了）</span></span></div><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"left\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　接下来就是产品备货、拍照、图片上传，我们假设图片编辑1人、产品采购1人、仓管兼打包1人、订单处理兼客服1人、财务1人、行政兼人事1人，人均薪资4000/ 月，五险一金没人约合1484/月，一个月的人员开支为（4000+1484）*6=32904/月 ，一年的成本就是394848</div><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"left\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　这里的前提是并有招聘具备运营能力的人，我们假设老板亲自负责其余所有事情，那么一年的大概开支：办公家具+房租水电＋研发部工资＋其他部门工资：<span style=\"word-wrap: break-word; font-weight: 700;\">5000+(10000+65808+32904)*12=1309544/ 年</span></div><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"left\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">　　当然，这里我仅仅做了一个初步的计算，并不十全十美，很多费用还未计算入内，比如备货成本，不过想要运营电商的朋友可以做一个参考，或者之后还有人想问你，做一个电商平台要多少钱，你可以告诉他，从无到有，你需要准备至少130万！</div><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"left\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\"><span style=\"word-wrap: break-word; font-weight: 700;color:#0000ff;word-wrap: break-word;\">都说创业难，但容易的事情都被别人做掉了，海盗云商投入资金人力研发，目的就是为想要电商创业的团队节约成本，至少我们可以为您省去一年80万的研发及投入，让大家把资金放到任何其他需要用到的地方，而运营等方式，海盗团队也会逐步推出各种平台，为创业者提供一个更好的环境，让运营电商不再是一个高成本的项目！</span></div><p><br/></p>', '1', '', '1', 'http://bbs.haidao.la/thread-921-1-1.html', '1464275489', '100', '', '248', '1');
INSERT INTO `hd_article` VALUES ('2', '海盗云商 · 免费宣言', '<p><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">[回归初心，从零起航]是海盗云商2016年提出的公司战略规划，在两年半的时间里，我们一直在思考，我们的初心是什么？再此，我们正式草拟这个帖子，希望大家能够在后续一如既往的支持海盗云商！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"center\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\"><span style=\"font-size:32px;word-wrap: break-word;\">免费宣言</span></div><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><ul type=\"1\" class=\"litype_1\" style=\"word-wrap: break-word; margin-left: 14px; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\"><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">迪米盒子科技有限公司旗下开源电商系统海盗云商于2016年4月1日在官方社区，重申我们对于电商事业的信心，并拟定《免费宣言》作为下一步服务电商事业的方向和依据。</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">我们认识到，我们做的海盗云商已经不仅仅是一个软件，在承担服务软件用户的责任之外，我们还有一个更为重要的使命，那就是怎样与电商从业者和创业者一起，共同推动电子商务在国内乃至全球的普及率。</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">我们重申一直以来对海盗云商用户的各项宗旨和原则的承诺，它们已证实是永不过时的，是普遍适用的。事实上，随着海盗云商和用户之间的相互联系和相互依赖日益增加，它们的现实意义更加重要。</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">我们决心在互联网上，进一步推动电子商务的整体价值提升，进一步降低电商从业者和创业者的进入门槛，进一步完善对各类电商的个性化服务及增值需求。</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">我们希望，通过海盗云商与用户之间的彼此信任，在电子商务大潮的各个阶段，都能够更好的服务于消费者，成为电子商务领域造福人类的一股最积极向上的力量。因为尽管电子商务给人们带来了巨大商机，但它的部分应用也带来了或多或少的负面效应。</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">我们始终认为做好扎实的基本功是电商的根基，某些价值并不是用金钱进行衡量，让基础服务彻底免费，让增值服务均用得起是海盗云商未来将持续贯彻的核心思想。</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">我们将秉承自由、安全、高性能、跨平台、迭代快以及优质服务为公司的几个价值核心，</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">为了把这些价值和原则变为行动，兹将我们特别重视的一些关键目标从2016年起，逐步展示于众。</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">我们将竭尽全力，在保证我们能够生存并持续发展的前提下，对海盗云商软件产品实施正式免费。以免费软件系统+付费增值服务的思路运营，因此，我们决心：让每一个海盗云商用户终生享受免费的升级服务及每周更新的技术支持。</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">我们希望海盗云商开源电子商务系统这款产品永远永远免费下去，如果非要在她前面加上一个期限，我们希望将是一万年。<br style=\"word-wrap: break-word;\"/></li></ul><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">针对已购买过海盗云商官方授权的用户声明：</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">首先我们感谢自海盗云商上线以来支持并购买了海盗云商授权的所有朋友，是你们的支持让海盗坚持了下来，我仅代表海盗云商全体同仁再此致谢！为了感谢这批支持者，我们希望能够让大家获得一些优待：</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><ul type=\"1\" class=\"litype_1\" style=\"word-wrap: break-word; margin-left: 14px; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\"><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">海盗云商社区授权勋章将不再发放，原勋章继续保留</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">自2016年4月1日起，所有之前购买过海盗云商授权的用户，均可获得海盗云商官方之后在云市场所提供的所有模块、模板以及插件十年免费使用权</li><li style=\"word-wrap: break-word; margin-left: 2em; list-style: decimal;\">优先体验或获得海盗云商新产品、新功能以及相关产品内侧名额<br style=\"word-wrap: break-word;\"/></li></ul><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">相关问答：</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">问：系统4月1日正式免费后我可以商业使用吗？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：可以，你无须再考虑是否会遭到海盗云商团队的任何法律起诉</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">问：系统是开源的，我自己有开发能力，可以基于系统再次开发并重新发布或出售吗？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商开源，但并未遵从任何开源协议，知识产权依旧归属海盗云商所属公司迪米盒子科技有限公司所有，不得进行二次销售</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">问：系统是免费了，但依旧有版权信息，我可以去除吗？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：不可以，如果你需要去除前台版权信息，包括移动端版权信息，请购买我们的增值服务，费用仅仅为￥800.00元</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">问：你们已经免费了，为何后台还是显示未授权？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：系统免费不代表使用的是授权版，授权版是去除了版权信息，只需要购买我们的增值服务即可，费用为￥800.00元</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">问：我还能再花￥8800.00的费用，获得之后所有官方提供的模块、插件、模板十年免费使用权吗？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：很抱歉，这是对老客户的回馈，过了这个村，就没这个庙了，之前怎么不支持我们呢</span></p><p><br/></p>', '1', '', '1', '', '1464275597', '100', '', '151', '1');
INSERT INTO `hd_article` VALUES ('3', '海盗云商2.0常见问题解答', '<p><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">近期很多朋友都在询问海盗云商2.0的动态，在这里我简单的做一些回答：</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0还是基于Think PHP的底层框架吗？是否继续开源？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商2.0之所以重构，就是因为TP框架已经无法满足海盗未来的发展，所以我们从底层进行了重构，底层框架使用的是海盗自主研发的框架，更加轻量级，拓展性更强，</span><span style=\"color:#008080;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"><span style=\"word-wrap: break-word; font-weight: 700;\">别质疑海盗团队底层框架研发能力以及稳定性</span></span><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">，至于开源，海盗云商自诞生就是开源产品，我们也会继续坚持产品开源，但开源不代表免费！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0什么时候发布？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商已于2015年12月18日发布2.0正式版！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0是否支持微信端？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商2.0的移动端属于独立模块，同时兼容所有移动设备，微信自然不例外！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0是否支持伪静态？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商2.0从2.0.2版本开始支持伪静态配置，配置方法请查看：</span><a href=\"http://bbs.haidao.la/thread-1148-1-1.html\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); text-decoration: underline; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">海盗云商2.0伪静态配置教程</a><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0没有第三方登录或者UCenter？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：系统默认是不提供的，会以插件形式提供，毕竟系统属于轻量级，过于繁杂的功能只会让系统过于臃肿，海盗的灵活性可以随意拓展任何功能！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商免费和授权有什么区别？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商是开源产品，自2016年4月1日起，正式永久免费，具体查看：</span><a href=\"http://bbs.haidao.la/thread-1486-1-1.html\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); text-decoration: underline; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">海盗云商·免费宣言</a><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0是否依然为6800元的授权？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商2.0的授权费会有所调整，目前授权费用上调2000元，授权价格为8800元，</span><span style=\"color:#008000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"><span style=\"word-wrap: break-word; font-weight: 700;\">自2016年4月1日起，正式永久免费，具体查看：</span></span><a href=\"http://bbs.haidao.la/thread-1486-1-1.html\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); text-decoration: underline; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">海盗云商·免费宣言</a><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">。</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0是否增加了大量的新功能？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：正好相反，海盗云商2.0减少了大量1.0有的功能，我们希望系统核心是轻量级、稳定安全的，同时所有1.0的功能均会以插件形式免费提供，当然也新增了一部分新的功能。详细功能请查看：</span><a href=\"http://bbs.haidao.la/thread-1074-1-1.html\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); text-decoration: underline; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">海盗云商2.0内置功能及开发进度</a><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0还是原来的界面吗？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商2.0的所有模板全部重新做了设计，并且做了大量代码优化，1.0的界面的确有很多问题，我们均在2.0做出了调整，当然包括后台的UI界面也做了标准化，更加简洁舒服了，当然，萝卜青菜各有所爱，我们只希望大部分用户能够喜欢我们的新模板。</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0会有更多的模板吗？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：这是肯定的，2.0发布后，我们会抓紧时间开发拓展插件以及新的模板，让大家的选择更加多元化，当然，有能力开发的也可以自行开发，毕竟是开源产品！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0的移动端有什么调整？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商2.0默认不带移动端，但别急，我们提供了移动端模块，并且是免费的，1.0修改移动端的模板其实很费力的，但2.0我们把移动端可视化了，编辑起来小白用户也能简单操作，但2.0的移动端模块不会同步和系统一并发布，大家给我们一些时间，我们会尽快推出。</span><a href=\"http://bbs.haidao.la/thread-1286-1-1.html\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); text-decoration: underline; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">海盗云商2.0移动端已正式发布</a><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：听说海盗云商要出云市场？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：无论消息从哪来，的确是的，海盗云市场是系统的辅助，让大家在运营过程中，有更多的插件、模块以及模板可以使用，具体上线时间，会稍晚一些，毕竟要给我们做一部分插件后再推出，并且支持服务商入驻，</span><span style=\"color:#008080;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">目前插件系统和模块系统均在开发，我们会尽快完成，预计云市场上线时间：2016年7月1日</span><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">。</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0只支持实体商品，不支持虚拟商品吗？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商默认是不带虚拟商品的，当然我们也会在之后的云市场提供虚拟商品插件，支持包括各种虚拟点卡，电话费等充值功能。</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：请问海盗云商有这样那样的功能吗？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商团队每天被此类问题无休止咨询，首先希望大家先了解海盗云商的默认功能：</span><a href=\"http://bbs.haidao.la/thread-1074-1-1.html\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); text-decoration: underline; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">海盗云商2.0内置功能及开发进度</a><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">，而非默认功能我们有钩子系统，会以插件形式在云市场提供，希望不要再问此类问题，如果急需的功能欢迎联系客服单独定制。</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云市场的插件模板收费吗？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：云市场的插件或模板有免费和付费的，但海盗官方提供的插件，即便付费也是廉价，目前暂定价格均是5-50元，官方会率先开发百余款插件提供给大家，让大家都能用得上，也用得起！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">问：海盗云商2.0是否有分销功能，是否是多店铺？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">答：海盗云商2.0为标准的B2C系统，是没有分销和多店铺的，但我们海盗团队正在开发的几款模块可以让海盗云商2.0变为分销系统或多店铺商城，只需一键安装即可，目前确定的模块为：分销模块、商家入驻模块、跨境电商模块，大家可以在官网提前了解一下这三大模块。</span></p>', '1', '', '1', '', '1464275653', '100', '', '135', '1');
INSERT INTO `hd_article` VALUES ('4', '到底何时才能够用海盗云商开始运营电商？！', '<p><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">海盗云商自产品第一个版本发布，已经历时一年半，60多个版本的迭代，这是我们每一个海盗人的态度和决心，目的很简单，为所有想做电商的企业、团队提供一套优质的系统，并且做好技术服务，让大家能够在电商运营过程中无需顾虑无法解决的技术问题，专心做好运营！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">所谓电子商务，一定要明白，商务才是核心、电子仅仅是促成更好商务的手段!</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">随着海盗云商的每一个版本迭代，大家可以看到海盗团队一直从无到有的努力做好每一次更新，让系统更加的完善，没有完美的系统，也没有可以满足100%用户的系统，但我们依然在努力向着这个方向去努力，我们希望得到结果，同时享受过程！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">但是在运营海盗云商的过程中，我们发现了大量的用户都在抱怨，在这里我们发文和大家讨论下！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">很多用户在问，海盗云商什么时候可以正式商用？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">我们很好奇，为什么提出这样的疑问，难道就因为群里和社区不断反馈的BUG导致的担心？想两个问题，希望给大家解决这方面的顾虑：1.你见过没有BUG的系统吗？2.给海盗云商反馈的BUG没人管吗？相信大家的答案都是一样的，没有无BUG得系统，我们欢迎大家反馈BUG，海盗云商迭代速度快，就是希望给大家技术的处理问题，而不是因为我们迭代速度快，反而让大家顾虑，系统没法用！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">很多用户还在问，这样功能那样功能其他系统都有，你们怎么没有，没有这些功能怎么上线？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">我们更加好奇，到底是什么缺了就会死人的功能让大家有这样的疑虑，做电商不是网站上线了，就是做电商了，商品拍摄和美工完成了么？分类做好了么？商品类型编辑完毕了没有？仓储物流是否已经准备妥当？OK，这些都搞定了，用户在哪？开始推广了没有？知道用户的需求是什么？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">我们遇到了太多这样的用户，把一切问题都抛给系统，而没有真正解决自己本身的问题，咨询的都是，积分功能什么时候上线？第三方登录什么时候可以用？UC整合都没搞定我们怎么上线推广？物流居然无法按照重量控制，怎么敢上线运营？</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">不要等万事俱备了，才开始行动，那时你会发现你真的晚了，海盗云商很多商业客户在什么都不成熟的基础上就开始运营，目前甚至还有在使用1.0系统，但运营很好的平台！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">海盗云商的云市场将于2016年7月1日上线试运营，届时会开始真正让大家看到系统的设计理念，钩子系统的强大，给大家解决更多的功能性问题</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">最后，感谢大家对海盗云商一直以来的支持，但希望大家不要等待，时间和机会是不会等你的！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">千万不要真的万事俱备了</span><span style=\"color:#008080;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">(该有的功能都有了)</span><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">，还在告诉我们，还欠东风</span><span style=\"color:#008000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">(真正该提前准备的什么都没做)</span><span style=\"color:#ff0000;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\">！</span></p>', '1', '', '1', '', '1464275718', '100', '', '218', '1');
INSERT INTO `hd_article` VALUES ('5', '核心产品-海盗云商v2.0正式版发布', '<p><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">历时近半年，无数个日夜，无数天的加班加点，海盗云商2.0如期上线，感谢所有研发团队的辛勤努力，感谢所有关注并支持海盗云商的朋友，海盗云商永远致力于重新定义电子商务系统行业标准，接下来海盗云商也会调整研发进度，让每周五的更新不会再晚点，不会再出现凌晨整个研发部还在辛苦发包的状态！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/></p><div align=\"center\" style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\"><span style=\"font-size:18px;word-wrap: break-word;\">==感言==</span></div><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">海盗云商自2014年12月发布1.0版本已经历时一年，在过去的这一年时间，海盗云商没有做任何的宣传和推广工作，但依然获得了大家的口碑宣传，感谢大家，很多人说海盗云商1.0问题很多，在此我们诚挚接受，经过了1.0的磨练，团队对电商系统有了更新的领悟，海盗云商团队自始至终不是一支纯粹的研发团队，而是一支拥有多年电商实战运营的团队，我们希望能够颠覆市场上的所有电商系统，让每一个用户都能用上真正灵活稳定安全的电商系统，为此我们付出了无数个日日夜夜！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">今天发布的2.0正式版相信会让大家满意，话不多说，所有功能请移步：</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><a href=\"http://bbs.haidao.la/thread-1074-1-1.html\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); text-decoration: underline; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">海盗云商2.0系统内置功能及介绍</a><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">从内置功能表中，大家可以看到有几项功能本次正式版我们还没有完成，当然我们会尽快提供，尤其是通知系统已经开发接近尾声，预计下周就能发布！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color:#008080;word-wrap: break-word; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"><span style=\"word-wrap: break-word; font-weight: 700;\">大家有问题可以反馈到BUG反馈区，我们依然会阅读每一位用户的帖子，完成每一周的发布，随着接下来几周的更新，海盗云商2.0会趋于稳定，自然之后如果没有发现问题，不会有新的补丁包，但每周五更新依然会坚持，虽然不会持续的更新原生系统，但我们会更新插件、模块、模板，相信大家都知道海盗云商之后会发布的几大模块，我们也会尽快推出！</span></span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">在团队的努力下，我们让这款灵活稳定安全的电商系统安装包压缩到了5.81MB，实现了我们希望的轻量级，但系统不大，功能却一点不弱！</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">系统下载地址：</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><a href=\"http://www.haidao.la/\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); text-decoration: underline; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">www.haidao.la</a><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; line-height: 21px; white-space: normal;\"/><span style=\"color: rgb(68, 68, 68); font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">更新日志：</span><a href=\"http://www.haidao.la/index.php?m=Product&c=Index&a=update_detail\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); text-decoration: underline; font-family: arial, Tahoma, Helvetica, &#39;Microsoft Yahei&#39;, sans-serif; font-size: 14px; font-style: normal; font-variant: normal; line-height: 21px; white-space: normal;\">请查看海盗云商历史日志</a></p><p><br/></p>', '1', '', '1', '', '1464275798', '100', '', '447', '1');
